export const addAccount = (data) => {
    return (dispatch) => {
      const myHeaders = new Headers();
      myHeaders.append("Content-Type", "application/json");

      const raw = JSON.stringify({
        name: "Adriana De Puerco",
        email: "PuercoVijdals@gmail.com",
        password: "1234777",
      });

      const requestOptions = {
        method: "POST",
        headers: myHeaders,
        body: raw,
        redirect: "follow",
      };
  };
};
